description:
Dr. Korner предлагает вкуснейшие полезные хлебцы из риса и кукурузы. При приготовлении используются цельнозерновые культуры и натуральные травы Прованса. Подобное сочетание помогает получить приятный вкус с изысканными нотками французской кухни. К тому же хрустящие хлебцы кроме вкуса и аромата дает ряд преимуществ для организма:
Улучшается пищеварение;
Поставляется больше клетчатки;
Увеличивается количество пищевых волокон.
Новые хлебцы станут настоящей находкой для ценителей здорового образа жизни и качественной пищи.

Фруктово-ореховый батончик клюква - 100% натуральный перекус.
Всегда читай состав. Никаких ароматизаторов, консервантов и красителей. Только натуральные ингредиенты – орехи и сухофрукты.  100 % натуральный продукт;
Не содержит ГМО, глютена, холестерина, сои и молока;
Без добавления красителей, консервантов и ароматизаторов;
Подходит веганам;
Можно употреблять в пост;
Удобно взять с собой.

